import React from 'react';

const Card = () => {
    return (
        <div className='bg-light-green'>
            <img alt='robot' src='https://robohash.org/test'></img>
            <div>
                <h2>Jane Doe</h2>
                <p>jane.doe@mail.com</p>
            </div>
        </div>
    );
}

export default Card;
